import "./diseño/CambioMovimiento.css";

import NumberFormat from 'react-number-format';

const CambioMovimiento = (props) => {
  return (
      <div className="grid-x" key={props.movement.id}>
        <div className="cell small-12 movement-row">
          <div className="grid-x">
            <div className="small-8 cell">
              <span>
                <img src={require('./img/iconEditar2.png')} width={25} onClick={() => props.actualizar(props.movement)} />
                <img src={require('./img/iconBorrar.png')} width={25} onClick={() => props.eliminar(props.movement.id)} />
                {props.movement.nombre}
              </span>
            </div>
            <div className="small-4 cell">
              <div className={props.movement.tipoMovimiento == 'deposit' ? "movement-type movement-deposit" : 'movement-type movement-pasivo'}> 
                <NumberFormat value={props.movement.value} displayType={'text'} thousandSeparator={true} prefix={'$'} />
              </div>
            </div>
          </div>
        </div>
      </div>

  );
};

export default CambioMovimiento;
